function timsort(arr) {
  if (arr.length <= 1) return arr;

  // split the array into smaller chunks
  const chunks = Math.ceil(arr.length / 32);
  const chunksize = 32;
  const chunksArr = [];
  for (let i = 0; i < chunks; i++) {
    const start = i * chunksize;
    const end = Math.min((i + 1) * chunksize, arr.length);
    chunksArr.push(arr.slice(start, end));
  }

  // sort each chunk
  for (let i = 0; i < chunks.length; i++) {
    const chunk = chunksArr[i];
    const sortedChunk = sort(chunk);
    const start = i * chunksize;
    const end = Math.min((i + 1) * chunksize, arr.length);
    arr.splice(start, end - start, ...sortedChunk);
  }

  return arr;
}

function sort(arr) {
  // insertion sort for small arrays
  if (arr.length <= 1) return arr;

  // compare each pair of elements and sort them
  for (let i = 0; i < arr.length - 1; i++) {
    for (let j = i + 1; j < arr.length; j++) {
      if (arr[i] > arr[j]) {
        const temp = arr[i];
        arr[i] = arr[j];
        arr[j] = temp;
      }
    }
  }

  return arr;
}
