```python
def longest_common_subsequence(str1, str2):
    def lcs_helper(i, j, common):
        if i == 0 or j == 0:
            return len(common)
        elif str1[i] == str2[j]:
            return lcs_helper(i - 1, j - 1, common + [str1[i]])
        else:
            return max(lcs_helper(i, j, common), lcs_helper(i, j - 1, common), lcs_helper(i - 1, j, common))

    return lcs_helper(len(str1), len(str2), [])

# Example usage:
str1 = "ADABA"
str2 = "ABCB"
print(longest_common_subsequence(str1, str2))  # Output: 3
```
The function `longest_common_subsequence` takes two input strings and returns the length of the longest common subsequence. The helper function `lcs_helper` is a recursive function that iterates through the characters of both input strings and builds the LCS sequence. The base case is reached when either `i` or `j` is equal to 0, which means there are no more characters to compare. The function then returns the length of the common subsequence.

The `lcs_helper` function takes the current indices `i` and `j`, the common subsequence up to the current point, and the remaining substring of the current sequence. It checks if the current characters of both input strings match. If they do, it adds the current character to the common subsequence and recursively calls the `lcs_helper` function with the updated indices. If they don't match, it compares the lengths of the LCS sequences generated by the three possible recursive calls: one where the current character of `str1` is included, one where the current character of `str2` is included, and one where neither character is included. It then returns the maximum length among these three options.

The function returns the length of the longest common subsequence of the input strings. In the example provided, the longest common subsequence between "ADABA" and "ABCB" is "ABA", which has a length of 3.

